import {OrgChartConfig} from "./org.chart.config";
import {RenderBoxEventArgs} from "./orgchart.events";

export class OrgChartTemplate {
	public fragment = '';

	public nodeTemplate: string;
	public rightConnectorTemplate: string;
	public leftConnectorTemplate: string;
	public topConnectorTemplate: string;
	public bottomConnectorTemplate: string;
	public horizontalConnectorTemplate: string;
	public definitions: string;

	constructor (private snap: Snap.Paper) {

		this.nodeTemplate = `<g width="220" height="93" transform="translate(##x##, ##y##)">
      <image width="457" height="194" transform="scale(0.48 0.48)" opacity="0.2" xlink:href="data:image/png;base64," style="mix-blend-mode: multiply"/>
      <path d="M205,73.92A5.07,5.07,0,0,1,200,79H20a5.07,5.07,0,0,1-5-5.08V20.08A5.07,5.07,0,0,1,20,15H200a5.07,5.07,0,0,1,5,5.08V73.92Z" fill="#fff"/>
      <rect x="49.96" y="46" width="52.75" height="1" transform="translate(29.83 122.83) rotate(-90)" fill="#bcbec0"/>
      <text transform="translate(84, 45)" font-size="12" fill="#d61f26" font-family="Roboto">Dorothy Example</text>
      <rect x="76" y="53" width="119" height="1" fill="#bcbec0"/>

      <image width="117" height="117" transform="translate(17.17 18.33) scale(0.48)" opacity="0.7" xlink:href="data:image/png;base64," style="mix-blend-mode: multiply"/>
      <path d="M45.17,71.33a25,25,0,1,1,25-25A25,25,0,0,1,45.17,71.33Z" fill="#f1f2f2"/>
      <g clip-path="url(#a)">
        <image width="256" height="256" transform="translate(17.48 16.65) scale(0.22)" xlink:href="data:image/png;base64,"/>
      </g>
      <text transform="translate(84.67 65.9)" font-size="10" fill="#939598" font-family="Roboto">Company employee</text>
    </g>`;

		this.definitions = '<clipPath id="a"><circle cx="45.17" cy="46.33" r="23.5" fill="none"/></clipPath>';
		this.snap.append(Snap.parse(this.definitions));
		this.snap.select('#a').toDefs();
	}

	private replaceAll(target: string, search: string, replacement: string): string {
		return target.replace(new RegExp(search, 'g'), replacement);
	}

	public collect(args: RenderBoxEventArgs) {
		var tpl = this.replaceAll(this.nodeTemplate, '##x##', args.x + '');
		tpl = this.replaceAll(tpl, '##y##', args.y + '');

		this.fragment += tpl;
	}

	public getTemplateFragment(): any {
		return Snap.parse(this.fragment);
	}
}
